   //   const email="sanjeevmishra@gmail.com";
     const[url,seturl]=useState("");
     Axios.get(`http://localhost:5050/api/userapi`)
    .then((response)=>{
       console.log( "response",response.data);
       seturl(response.data[5].url);
    })

    
    return(
        <div>
           <img style={{width:300}} src={url} alt="sorry" />
           <img style={{width:300}} src={props.url} alt="sorry"/>
        </div>
    )
}

export default Show;
